description:
It has always been interesting for me that we can only experience the world through the filter of our own consciousness and experiences. I am a very frequent daydreamer and I tend to go so deep into my thoughts that I forget the physical world around me exists, and not always at the most appropriate times. But it's weird that the real world might not be as big of a part in our everyday lives as we may think, and a very large part of our waking lives we just spend wrapped up in our own minds. 

This piece was digitally painted by me, including every frame of the animation. You can see some of the beginning process on my instagram account (@iamsphere) and my twitter account (@I_am_Sphere).

